@mcaffeineofficial Extremely disappointed with the Sun Bath Spray for which I got yesterday. The product I received was clearly used, not new as promised. The packaging was not sealed at all, which is unacceptable for any genuine product. On top of that, almost half of the product was already missing, making it obvious that this item had been opened and used before being sent to me.
This feels like a complete breach of trust and very poor quality control. When customers pay for a new product, they expect proper hygiene, sealed packaging, and full quantity - not a partially used item. Such careless handling reflects badly on the brand and raises serious concerns about authenticity and safety. I would strongly advise others to be cautious before ordering, as this experience was frustrating and disappointing.

To make matters worse, when I tried contacting the team on WhatsApp for support, their response was unprofessional and dismissive. They either avoided the issue or failed to respond properly, showing a complete lack of accountability. Instead of resolving a genuine complaint, they chose to ignore it, which only adds to the frustration. This kind of customer service is unacceptable and reflects how little they care once the payment is done. Overall, this has been a terrible experience from product quality to after-sales support.

